text_show:
Luis Bedoya, actual presidente de la Federación Colombiana de Fútbol fue elegido este viernes como nuevo representante de la Conmebol ante el Comité Ejecutivo de la FIFA, tras reunión del Comité Ejecutivo del máximo ente del fútbol sudamericano en Asunción, Paraguay.
Así quedo constituido el nuevo Comité Ejecutivo de la Confederación Sudamericana de Fútbol:
Presidente: Juan Ángel Napout (Paraguay);
Vicepresidentes: Luis Bedoya Giraldo (Colombia), Sergio Jadue (Chile) y Rafael Esquivel (Venezuela);
Tesorero: Carlos Chávez Landivar (Bolivia);
Secretario General: José Luís Meiszner (Argentina);
Directores: José María Marín (Brasil), Luis Chiriboga (Ecuador), Manuel Burga Seoane (Perú), Wilmar Valdez (Uruguay), Luis Segura (Argentina) y Alejandro Domínguez (Paraguay).
Estos serán los representantes de CONMEBOL en el Comité Ejecutivo de la FIFA:
Vicepresidente del Comité Ejecutivo de la FIFA: Eugenio Figueredo
Miembro del Comité Ejecutivo de la FIFA: Luis H. Bedoya Giraldo
Miembro del Comité Ejecutivo de la FIFA: Marco Polo del Nero
